import ExpenseItem from "./ExpenseItem";

function Expenses(props){

    const expense = props.items;
    
    return (

        <div>
                  <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
    
        </div>

   
    );

}

export default Expenses;
